function ToDoItem(props){

const [isLineThrough,setLineThrough]=useState(false);


function handleClick()
{      
    setLineThrough(true);
}



return (
 <div>
       <li style={{}} onClick={handleClick}>{props.text}</li>
 </div>
)


}

export default ToDoItem;
